import './App.css';
import Header from './Components/Header';
import About from './Components/About';
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
          <Headers/>
          </Route>
        </Switch>


    </div>
    </Router>
  );
}

export default App;
